fn convert_json_to_constants(json_str: &str) -> Vec<String> 
{
    let json: Value = serde_json::from_str(json_str).expect("Failed to parse JSON");
    
    json.as_array()
        .expect("JSON should be an array")
        .iter()
        .map(|item| {
            let name = item["name"].as_str().expect("Name should be a string");
            let id = item["id"].as_str().expect("ID should be a string");
            
            let const_name = name.to_uppercase()
            .replace(" ", "_")
            .replace(",", "")
            .replace("\"", "")
            .replace("-", "")
            .replace("(", "")
            .replace(")", "")
            .replace("«", "")
            .replace("»", "")
            .replace("№", "")
            .replace("–", "");
        
        
            
            format!("pub const {}: &'static str = \"{}\";", const_name, id)
        })
        .collect()
}
